INSERT INTO `tblemails` VALUES (653,604,'Welcome','<style>\nbody,td { font-family: verdana; font-size: 11px; font-weight: normal; }\r\na { color: #0000ff; }\n</style><p><a href=\"http://localhost/whmcs\" target=\"_blank\"><img src=\"\" alt=\"Company Name\" border=\"0\" /></a></p>\n<p>\r\nDear Joe Doe, \r\n</p>\r\n<p>\r\nThank you for signing up with us. Your new account has been setup and you can now login to our client area using the details below. \r\n</p>\r\n<p>\r\nEmail Address: awef@af.co<br />\r\nPassword:  \r\n</p>\r\n<p>\r\nTo login, visit http://localhost/whmcs/ \r\n</p>\r\n<p>\r\nSignature goes here... \r\n</p>\r\n','2015-07-25 08:59:40','awef@af.co','',''),(654,604,'SSL Expiring Soon','<style>\nbody,td { font-family: verdana; font-size: 11px; font-weight: normal; }\r\na { color: #0000ff; }\n</style><p><a href=\"http://localhost/whmcs\" target=\"_blank\"><img src=\"\" alt=\"Company Name\" border=\"0\" /></a></p>\n<p>Your Super SSL for unittests.com is set to expire on 15-07-25 <br/>Please renew today to avoid any interruption. <br/><br/> Signature goes here...</p>','2015-07-25 09:00:23','awef@af.co','',''),(655,604,'[Ticket ID: 180491] Expiring SSL Certificate','<style>\nbody,td { font-family: verdana; font-size: 11px; font-weight: normal; }\r\na { color: #0000ff; }\n</style><p><a href=\"http://localhost/whmcs\" target=\"_blank\"><img src=\"\" alt=\"Company Name\" border=\"0\" /></a></p>\n<p>\r\nJoe Doe,\r\n</p>\r\n<p>\r\nThank you for contacting our support team. A support ticket has now been opened for your request. You will be notified when a response is made by email. The details of your ticket are shown below.\r\n</p>\r\n<p>\r\nSubject: Expiring SSL Certificate<br />\r\nPriority: Low<br />\r\nStatus: <span style=\"color:#779500\">Open</span>\r\n</p>\r\n<p>\r\nYou can view the ticket at any time at <a href=\"http://localhost/whmcs/viewticket.php?tid=180491&c=SEarlrID\">http://localhost/whmcs/viewticket.php?tid=180491&c=SEarlrID</a>\r\n</p>\r\n<p>\r\nSignature goes here...\r\n</p>\r\n','2015-07-25 09:00:23','awef@af.co','',''),(689,615,'Welcome','<style>\nbody,td { font-family: verdana; font-size: 11px; font-weight: normal; }\r\na { color: #0000ff; }\n</style><p><a href=\"http://localhost/whmcs\" target=\"_blank\"><img src=\"\" alt=\"Company Name\" border=\"0\" /></a></p>\n<p>\r\nDear SSL ReminderTest, \r\n</p>\r\n<p>\r\nThank you for signing up with us. Your new account has been setup and you can now login to our client area using the details below. \r\n</p>\r\n<p>\r\nEmail Address: ssltest@mycircletree.com<br />\r\nPassword: 1234 \r\n</p>\r\n<p>\r\nTo login, visit http://localhost/whmcs/ \r\n</p>\r\n<p>\r\nSignature goes here... \r\n</p>\r\n','2015-07-25 12:33:59','ssltest@mycircletree.com','',''),(690,615,'Order Confirmation','<style>\nbody,td { font-family: verdana; font-size: 11px; font-weight: normal; }\r\na { color: #0000ff; }\n</style><p><a href=\"http://localhost/whmcs\" target=\"_blank\"><img src=\"\" alt=\"Company Name\" border=\"0\" /></a></p>\n<p>\r\nDear SSL ReminderTest, \r\n</p>\r\n<p>\r\nWe have received your order and will be processing it shortly. The details of the order are below: \r\n</p>\r\n<p>\r\nOrder Number: <b>3396180269</b></p>\r\n<p>\r\nProduct/Service: Foo - test client product<br>\nDomain: mycircletree.com<br>\nFirst Payment Amount: $0.00 USD<br>\nBilling Cycle: Free Account<br>\n<br>\nTotal Due Today: $0.00 USD \r\n</p>\r\n<p>\r\nYou will receive an email from us shortly once your account has been setup. Please quote your order reference number if you wish to contact us about this order. \r\n</p>\r\n<p>\r\nSignature goes here...\r\n</p>\r\n','2015-07-25 12:34:00','ssltest@mycircletree.com','','');
